import Axios from "axios";

const KEY = "AIzaSyBne86MIlkfTEmsqpAcL33_wuwj0wm9d-8";

export default Axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3",
  params: {
    part: "snippet",
    maxResults: 5,
    type: "video",
    key: KEY,
  },
});
